import leaf from "../images/leaf.svg";

const Animation = () => {
  return (
    <section className="w-[100%]">
      <div className="container">
        <div id="rssBlock" className="w-[100%]">
          <p className="cnnContents flex">
            <span className="marqueeStyle flex text-[127px] font-normal">
              <div>
                <img src={leaf} alt="" />
              </div>
              <div>Mugs</div>
            </span>
            <span className="marqueeStyle2 text-[127px] font-normal">
              <img src={leaf} alt="" /> Plates
            </span>
          </p>
        </div>
      </div>
    </section>
  );
};
export default Animation;
